import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate a specific product card using its text content and click it
    // Using a more specific locator to avoid ambiguity
    const productCard = page.locator('.product-card', { hasText: 'Sony WH-1000XM5 Wireless Noise Canceling Headphones' });
    await productCard.waitFor({ state: 'visible' });
    await productCard.hover();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_hover.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_hover.png'));
    await productCard.click();

    // 2. Wait for the product detail modal to appear
    const productModal = page.locator('#productModal');
    await productModal.waitFor({ state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_product_modal.png'));

    // 3. Find and click the "Add to Wish List" button within the modal
    // Using getByRole for better accessibility and robustness
    const addToWishlistButton = productModal.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.click();

    // 4. Wait for the success notification to appear
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible' });
    const notificationText = await notification.textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_notification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_notification.png'));

    // 5. Verify the item was added by checking localStorage
    const wishlistItem = await page.evaluate(() => {
      const wishlistData = localStorage.getItem('amazonWishlist');
      if (!wishlistData) return null;
      const wishlist = JSON.parse(wishlistData);
      // The Sony headphones have product ID 3 in the mock data
      return wishlist.find(item => item.id === 3);
    });

    if (!wishlistItem || wishlistItem.title !== 'Sony WH-1000XM5 Wireless Noise Canceling Headphones') {
      throw new Error('Product was not found in the wishlist in localStorage.');
    }

    return {
      success: true,
      action: "Successfully added 'Sony WH-1000XM5' headphones to the wishlist.",
      extractedData: {
        notification: notificationText,
        addedItem: wishlistItem
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
